import React from "react";

export default function Semcard(props){
  return (
    <div className="relative">
      <div className="absolute p-20 m-4 w-40 h-40 border-4 border-gray-800 bg-white">
        <p className="font-bold text-4xl">{props.sem}</p>
      </div>
      <div className="absolute p-20 m-4 border-4 border-gray-800 bg-green-200">{" "}</div>
    </div>
  );
}
